import React from 'react';
import logo from '../../img/WF-Athletics-Logo-Black.png';

const Navbar = () => (
    <div className="row">
        <div className="col s1">
            <i className="large material-icons">arrow-back</i>
        </div>
        <img className="logo-img col s10" src={logo} alt="Wonderfly Logo"></img>
        <div className="col s1"></div>

    </div>
)

export default Navbar
